import styles from './Input.module.css'

const Input = (props) => {
  return (
    <div className={`${styles.container} ${props.additionalStyles}`}>
			<label className={`${styles.container} ${props.additionalStyles}`}for={props.id}>{props.label}</label>
      <input className={`${styles.container} ${props.additionalStyles}`} id={props.id} type={props.type}></input>
    </div>
  );
};

export default Input;
